import React from 'react';
import ReactDOM from 'react-dom';
import Layout from '../components/MyLayout';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';

export default function Classification() {
    return (
        <Layout>
            <p>Document Classifications by Customers</p>
                <div class="row">
                    <div class="col-md-1">
                        <DropdownButton id="dropdown-customers" title="Customer Names">
                            <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                            <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item eventKey="4">Clear all selections</Dropdown.Item>
                        </DropdownButton>
                    </div>
                    <div class="col-md-1">
                        <DropdownButton id="dropdown-documents" title="Document Types">
                            <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                            <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                            <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item eventKey="4">Clear all selections</Dropdown.Item>
                        </DropdownButton>
                    </div>
                </div>
        </Layout>
    );
}
